import React from "react";
import "./role.css"

const Role = () => {
  return (
    <div>
      <div className="allRoleContainer">
        <div class="card">
          <div class="card-details">
            <p class="text-title">Card title</p>
            <p class="text-body">Here are the details of the card</p>
          </div>
          <button class="card-button">More info</button>
        </div>
      </div>
    </div>
  );
};

export default Role;
